eft:57px;text-indent:-47px;line-height:1.343;margin-top:0px;margin-bottom:0px;text-align:justify;\" >\n<span class=\"text63174Font3\" style=\"position:relative;top:-1px;\" >KI 4</span ><span class=\"text63174Font4\" style=\"position:relative;top:-1px;\" > : &nbsp;Mengolah, menyaji, dan menalar dalam ranah konkret (menggunakan, mengurai, merangkai, memodifikasi, dan membuat) dan ranah abstrak (menulis, membaca, menghitung, menggambar, dan mengarang) sesuai dengan yang dipelajari di sekolah dan sumber lain yang sama dalam sudut pandang/teori</span ></p >\n</td >\n</tr >\n<tr style=\"vertical-align:top\"  >\n</tr >\n<tr style=\"vertical-align:top\"  >\n</tr >\n<tr style=\"vertical-align:top\"  >\n</tr >\n</table ></div >\n</div>\n');
